// src/components/Dashboard.js
import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';

const Dashboard = () => {
  const [projects, setProjects] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchProjects = async () => {
      setLoading(true);
      try {
        const projectsResponse = await axios.get('http://localhost:5000/projects');
        setProjects(projectsResponse.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchProjects();
  }, []);

  const handleLogout = () => {
    localStorage.removeItem('token'); // Eliminar el token al cerrar sesión
    console.log('User logged out');
  };

  const isAuthenticated = !!localStorage.getItem('token'); // Verificamos si el usuario está autenticado

  return (
    <div className="dashboard">
      <h1>NetBurrito</h1>

      {/* Botones para navegar solo si no están autenticados */}
      <div className="navigation-buttons">
        {!isAuthenticated && (
          <>
            <Link to="/signup"><button>Sign Up</button></Link>
            <Link to="/login"><button>Login</button></Link>
          </>
        )}
        {isAuthenticated && (
          <button onClick={handleLogout}>Logout</button>
          
        )}
      </div>

      <h2>Proyectos Recientes</h2>
      {loading ? (
        <p>Cargando proyectos...</p>
      ) : (
        <ul>
          {projects.map((project) => (
            <li key={project._id}>
              <h3>{project.name}</h3>
              <p>{project.description}</p>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
};

export default Dashboard;
